import React, { useEffect, useState } from "react"
import RsvpIndividual from './RsvpIndividual';
import RsvpList from './RsvpList';
import { GetList } from '../../../Data/Database';

export default function RsvpAdmin(props) {

    const [selected, setSelected] = useState({});
    const [list, setList] = useState([]);

    function test() {
        console.log("here");
    }

    useEffect(() => {
        GetList(props.auth)
            .then(data => {
                setList(data.data);
            })
            .catch(err => {
                console.log("Error :", err);
            })
    }, [props.auth])

    return (
        <>
            <h2>{selected !== {} ? "Rsvp List" : selected.name + " Rsvp"}</h2>
            {
                selected !== {} ?
                    <RsvpList setSelected={test}
                        list={list} />
                    : <RsvpIndividual setSelected={this.test}
                        selected={selected} />
            }
        </>
    )
}
